                    result_sentence += f"{subject} is {obj} metres above sea level"
                else:
                    result_sentence += f", which is {obj} metres above sea level"
            elif predicate == "runwayLength":
                if not result_sentence:
                    result_sentence += f"{subject} has a runway length of {obj} metres"
                else:
                    result_sentence += f", with a runway length of {obj} metres"
            elif predicate == "country":
                if not result_sentence:
                    result_sentence += f"{subject} is in {obj}"
                else:
                    result_sentence += f", located in {obj}"
            elif predicate == "isPartOf":
                if not result_sentence:
                    result_sentence += f"{subject} is part of {obj}"
                else:
                    result_sentence += f", which is part of {obj}"
            elif predicate == "language":
                if not result_sentence:
